  @Input() testo: any = "";
  @Output() alyofonts = new EventEmitter()

  listaTesti: any = [];
  fonts: any = "001"
  lunghezza_testo = 0;
  lunghezza_caratteri = 0;

  constructor() { }

  ngOnInit(): void {

    // this.s("TESTO: ",this.convertiultimocarattere(testo,this.rilevamentoFonts(testo)))
    this.alyofonts.emit(this);
  }

  converetitestofontrandom(testo: any){
    return this.convertiTesto(testo,this.fontrandom())
  }

  fontrandom(){
    return Math.floor(Math.random() * Object.keys(this.caratteri).length);
  }

  converticarattere(carattere: string,font: string){
    var carattereconvertito = this.caratteri[font][carattere]
    if(carattereconvertito != undefined){return carattereconvertito}
    else{return carattere;}
  }

  convertiultimocarattere(testo: any,font: any){ 
    return testo.slice(0,-1)+this.converticarattere(testo[testo.length-1],font)
  }

  convertiTesto(testo: any,font: any){
    
    var testoconvertito = ""
    for(var carattere of testo){
      testoconvertito = testoconvertito + this.converticarattere(carattere,font)
    }
    return testoconvertito
  }
  
  rilevamentoFonts(testo: string){

    var lista_id: any = {}
    for(const [key, val] of Object.entries(this.caratteri)){
      lista_id[key] = 0
      for(let k of testo){
        if(this.caratteri[key][k] != undefined){ lista_id[key] = lista_id[key]+1;}
      }
    }

    var max = 0,id: any = 0;
    for(const [key, val] of Object.entries(lista_id)){
      if(lista_id[key] > max){max = lista_id[key], id = key}
    }

    return id;
  }
  
